content: "\n\n> [!NOTE]\n> FRx समर्थन उस तिथि को समाप्त होता है जब तक कि गतिशीलता उत्पाद के घटक के रूप में वितरित न किया जाए। जब एक गतिशीलता उत्पाद के साथ वितरित किया जाता है, तो गतिशीलता जीवनचक्र FRx तिथियों को ओवरराइड करता है।"
